import React, { useState } from 'react';
import SelectOption from './SelectOption.jsx';
import SelectEntered from './SelectEntered.jsx';
import classes from './FormBooking.module.scss';

const FormBooking = (props) => {
    const [date_arrival, setDateArrival] = useState();
    const [date_leave, setDateLeave] = useState();

    return(
        <div className={classes.booking}>
            <div className={classes.info_going}>
                <div className={classes.date_arrival}>
                    <label>Дата приъезда</label>
                    <input type="date" value={date_arrival}/>
                </div>
                <div className={classes.date_leave}>
                    <label>Дата отъезда</label>
                    <input type="date" value={date_leave}/>
                </div>
                <div>
                    <label>Размещение в номере</label>
                    <SelectOption values={[ '1 взрослый', '2 взрослый' ]} placeholder='Взрослые'/>
                </div>
                <div>
                    <SelectEntered/>
                </div>
            </div>
            <div className={classes.info_person}>
                
            </div>
        </div>
    )
}

export default FormBooking;
